@dashesy - Yes, this tracer warning is coming from PyTorch exporter and we have seen this before. Most of the times this warning is legitimate in that the JIT tracer cannot accurately capture the semantics of the dynamic ops, like the indexing op you show in your example, and instead captures a static constant for that specific run. This is what the warning is about. I think the tracer warning is pointing to a legit concern here. See the "Limitations" section in this [PyTorch page.](https://pytorch.org/docs/master/onnx.html?highlight=onnx#module-torch.onnx)

The recommended way to capture this dynamic behavior is to use [TorchScript](https://pytorch.org/docs/stable/jit.htmlhttps://pytorch.org/docs/stable/jit.html) in the export. Here's an example, that shows slicing, that shows the use of TorchScript:
```
@torch.jit.script
def slice_helper(x, offset ):
    return x[:offset ]

class CenterCrop(torch.nn.Module):
    def __init__(self, crop_size):
        """Crop from the center of a 4d tensor
        :param crop_size: the center crop size
        """
        super(CenterCrop, self).__init__()
        self.crop_size = crop_size
    
def forward(self, x):
        offset = (x.shape[2] - self.crop_size) / 2
        return slice_helper(x, offset )
```

@spandantiwari I changed the code to this

```python
@torch.jit.script
def center_slice_helper(x, h_offset, w_offset, crop_size):
    return x[:, :, h_offset:h_offset + crop_size, w_offset:w_offset + crop_size]


class CenterCrop(nn.Module):
    def __init__(self, crop_size):
        """Crop from the center of a 4d tensor
        :param crop_size: the center crop size
        """
        super(CenterCrop, self).__init__()
        self.crop_size = crop_size

    def extra_repr(self):
        """Extra information
        """
        return 'crop_size={}'.format(
            self.crop_size
        )

    def forward(self, x):
        assert x.shape[3] > self.crop_size + 2 and x.shape[2] > self.crop_size + 2, \
            "height: {} or width: {} is less than crop_size: {}".format(x.shape[2], x.shape[3], self.crop_size)
        h_offset = torch.tensor((x.shape[2] - self.crop_size) / 2)
        w_offset = torch.tensor((x.shape[3] - self.crop_size) / 2)
        return center_slice_helper(x, h_offset, w_offset, torch.tensor(self.crop_size))
```

I think it now respects dynamic sizes, but it does not remove warning unless I move the assert to the `center_slice_helper` torch script. 

